import React from 'react';

function ToReadList({ books }) {
    return (
        <div>
            <h2>To Read List</h2>
            <ul>
                {books.map((book, index) => (
                    <li key={index}>{book}</li>
                ))}
            </ul>
        </div>
    );
}

export default ToReadList;
